import Navbar from './Navbar'

const Layout = (props) =>(
    <div>
        <Navbar />
        <hr />
        <hr />
        {props.children}
        <style jsx>{`
        div {
            margin: auto;
            width: 50%;
            border: 3px solid green;
            padding: 10px;
            text-align: center;
          }

          .light {
            background-color: #999;
          }
      `}</style>
    </div>
);

export default Layout;
